import base64
import gzip
import xml.etree.ElementTree as ET

# base64デコード
compressed_data = base64.b64decode("")

# gzip解凍
xml_data = gzip.decompress(compressed_data)

# XMLとして読み込み
root = ET.fromstring(xml_data)

# XML文字列として出力
xml_str = ET.tostring(root, encoding='utf-8', method='xml').decode('utf-8')

print(xml_str)
